import React from "react";
import "./App.css";
import logo from "./logo.svg";
import Parallax from "./Parallax.js";
const url = "localhost:3000";

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <p>roosa aurora</p>
        <a
          className="App-link"
          href={url + "#test"}
          target="_blank"
          rel="noopener noreferrer"
        >
          Learn React
        </a>
        <img src={logo} className="App-logo" alt="logo" />
      </header>
      <body>
        <Parallax isDark={true} title="asd" message="Test message" />
        <Parallax isDark={false} title="fgd" message="Another message" />
        <Parallax isDark={false} title="fds" message="Third message" />
      </body>
    </div>
  );
}

export default App;
